jd-senior-backend	Senior Backend Engineer	Engineering	# Senior Backend Engineer\n\n## About the Role\nWe're looking for a Senior Backend Engineer to join our growing engineering team. You'll be responsible for designing, building, and maintaining our core platform services.\n\n## Responsibilities\n- Design and implement scalable backend services and APIs\n- Lead technical discussions and code reviews\n- Mentor junior engineers and contribute to team growth\n- Collaborate with product and design teams to deliver features\n- Ensure high code quality through testing and best practices\n- Participate in on-call rotations\n\n## Requirements\n- 5+ years of backend development experience\n- Strong proficiency in Node.js, Python, or Go\n- Experience with PostgreSQL, Redis, and message queues\n- Understanding of distributed systems and microservices\n- Excellent problem-solving and communication skills\n\n## Nice to Have\n- Experience with Kubernetes and cloud platforms (AWS/GCP)\n- Contributions to open source projects\n- Experience in fintech or insurtech	1	t	2025-12-29 02:23:42.019	2025-12-29 02:23:42.019
jd-product-designer	Product Designer	Design	# Product Designer\n\n## About the Role\nWe're seeking a talented Product Designer to help shape the future of our platform. You'll work closely with product and engineering teams to create intuitive, beautiful user experiences.\n\n## Responsibilities\n- Lead end-to-end design for new features and products\n- Conduct user research and usability testing\n- Create wireframes, prototypes, and high-fidelity designs\n- Maintain and evolve our design system\n- Collaborate with engineers to ensure design quality\n- Present designs to stakeholders and incorporate feedback\n\n## Requirements\n- 3+ years of product design experience\n- Strong portfolio demonstrating UX/UI expertise\n- Proficiency in Figma and prototyping tools\n- Experience with design systems\n- Excellent communication and collaboration skills\n\n## Nice to Have\n- Experience with B2B or enterprise products\n- Basic understanding of HTML/CSS\n- Motion design skills	1	t	2025-12-29 02:23:42.047	2025-12-29 02:23:42.047
jd-devops-engineer	DevOps Engineer	Engineering	# DevOps Engineer\n\n## About the Role\nWe're seeking a DevOps Engineer to help build and maintain our cloud infrastructure. You'll work on CI/CD pipelines, monitoring, and ensuring system reliability.\n\n## Responsibilities\n- Design and maintain cloud infrastructure on AWS/GCP\n- Build and optimize CI/CD pipelines\n- Implement monitoring, alerting, and logging solutions\n- Ensure security best practices across infrastructure\n- Automate deployment and operational tasks\n- Participate in incident response and on-call rotations\n\n## Requirements\n- 3+ years of DevOps/SRE experience\n- Strong experience with Kubernetes and Docker\n- Proficiency with IaC tools (Terraform, Pulumi)\n- Experience with CI/CD platforms (GitHub Actions, GitLab CI)\n- Understanding of networking and security\n\n## Nice to Have\n- Certifications (AWS, GCP, CKA)\n- Experience with service mesh (Istio, Linkerd)\n- Background in software development	1	t	2025-12-29 02:23:42.049	2025-12-29 02:23:42.049
jd-frontend-engineer	Frontend Engineer	Engineering	# Frontend Engineer\n\n## About the Role\nWe're looking for a Frontend Engineer to build beautiful, performant user interfaces. You'll work closely with designers and backend engineers to deliver exceptional user experiences.\n\n## Responsibilities\n- Build and maintain React/Next.js applications\n- Implement responsive, accessible UI components\n- Optimize frontend performance and bundle size\n- Write unit and integration tests\n- Contribute to our component library\n- Collaborate with designers on implementation\n\n## Requirements\n- 3+ years of frontend development experience\n- Strong proficiency in React and TypeScript\n- Experience with modern CSS (Tailwind, styled-components)\n- Understanding of web performance optimization\n- Familiarity with testing frameworks (Jest, Playwright)\n\n## Nice to Have\n- Experience with Next.js and server-side rendering\n- Animation and motion design skills\n- Contributions to design systems	1	t	2025-12-29 02:23:42.049	2025-12-29 02:23:42.049
jd-growth-lead	Growth Lead	Growth	<h2><span style="color: rgb(59, 130, 246);"><strong>Your Objective</strong></span></h2><p>Youre a dynamic Growth Marketing Leader, who will be responsible for crafting and executing a comprehensive marketing strategy. This includes overseeing various marketing domains such as product marketing, performance marketing, events, social media marketing, and partnerships.</p><p></p><p></p><h2><strong>How you'll help us achieve it</strong></h2><ul><li><p>Develop and oversee the company's growth strategy in collaboration with Curacel's Management Team.</p></li><li><p>Establish a robust growth and marketing division within Curacel</p></li><li><p>Regularly report and forecast crucial business metrics, including customer growth, retention, revenue, engagement, NPS, and profit margins.</p></li><li><p>Innovate in user acquisition, targeting the first major milestones of customers.</p></li><li><p>Gain an in-depth understanding of our current and potential users and their motivations.</p></li><li><p>Master our customer acquisition channels, marketing funnels, and tools.</p></li><li><p>Manage the marketing budget effectively across various tools and channels.</p></li><li><p>Lead growth experimentation, optimising existing channels and exploring new opportunities.</p></li><li><p>Champion a data-driven culture, emphasising instrumentation and attribution.</p></li><li><p>Work closely with the Product Team to refine user experience, copy, and messaging.</p></li><li><p>Maintain and develop the Curacel brand and voice, ensuring consistency across all communications.</p></li><li><p>Lead and expand the Growth/Marketing Team.</p></li></ul><h2><strong>In your first month, you'll</strong></h2><ul><li><p>Learn what we do, how our product works and what new products we are building.</p></li><li><p>Build a structure for monitoring progress and measuring the success of campaigns and marketing activities.</p></li><li><p>Gain an in-depth understanding of our current and potential users and their motivations.</p></li><li><p>Review existing content calendar and create a new one for our social media, newsletter and blog.</p></li><li><p>Lead the creation of reports and white papers for insurance, claims management, fraud detection, embedded insurance in Africa.</p></li><li><p>Lead the creation of video testimonials of our clients across Africa.</p></li></ul><p><strong>Requirements</strong></p><ul><li><p>Minimum of 6 years of experience in B2B Marketing, with a focus on both small and medium-sized businesses, SEO and growth marketing.</p></li><li><p>Proficient in marketing analytics and applying insights to optimise campaigns.</p></li><li><p>Demonstrated ability in being analytical and data-driven.</p></li><li><p>Strong leadership skills, with the ability to work with cross-functional teams.</p></li><li><p>Proven track record of growth, with examples and outcomes of previous campaigns.</p></li><li><p>Exceptional written, oral, and organisational skills.</p></li><li><p>Experience in managing comprehensive, data-driven marketing, and communication strategies.</p></li><li><p>Familiarity with relevant marketing tools and platforms for campaign activation.</p></li></ul><h2><strong>Bonus points if you</strong></h2><ul><li><p>Have B2B SaaS marketing experience</p></li></ul><h2><strong>Key details</strong></h2><ul><li><p>The growth marketing position is a full-time position and reports to the CEO.</p></li></ul><p><strong>Benefits:</strong></p><ul><li><p>Subsidized health insurance</p></li><li><p>Monthly data allowance</p></li></ul><p></p>	4	t	2025-12-29 02:23:42.048	2026-01-02 16:00:15.239
8b0fce2d-4fb9-4b1f-800b-849c7c9f1dcf	GTM Engineer	Commercial	<div class="jd-section">\n<h2>Overview</h2>\n<p>Curacel is a leading African insurtech company using AI, data, and modern software to transform insurance infrastructure across the continent. We partner with insurers, brokers, and healthcare providers to eliminate fraud, improve efficiency, and create seamless insurance experiences at scale.\n\nAs a GTM (Go-To-Market) Engineer in the Commercial team, you will sit at the intersection of product, engineering, sales, and marketing. Your role is to design, build, and optimize the technical and operational systems that power Curacels revenue growthfrom lead acquisition and onboarding to integrations, pricing experiments, and customer expansion.\n\nThis role matters because Curacels growth depends not just on great products, but on how efficiently and intelligently we take them to market. You will directly impact revenue velocity, customer experience, and scalability, enabling Curacel to grow faster and smarter across multiple markets.</p>\n</div>\n<div class="jd-section">\n<h2>Key Responsibilities</h2>\n<ul>\n<li>Design, implement, and maintain GTM systems and tooling that support sales, partnerships, and customer success (CRM, automation, analytics, integrations).</li>\n<li>Work closely with Sales, Marketing, Product, and Engineering teams to translate commercial needs into scalable technical solutions.</li>\n<li>Build and optimize workflows for lead management, onboarding, pricing, and customer lifecycle management.</li>\n<li>Develop dashboards and reporting frameworks to track funnel performance, revenue metrics, and GTM efficiency.</li>\n<li>Support pre-sales and post-sales technical engagements, including demos, integrations, and solution design for enterprise customers.</li>\n<li>Identify bottlenecks in the go-to-market process and proactively design experiments and improvements.</li>\n<li>Own documentation and knowledge-sharing around GTM systems, processes, and best practices.</li>\n<li>Continuously evaluate and recommend new tools, technologies, and processes to improve speed, accuracy, and impact.</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>Required Qualifications</h2>\n<ul>\n<li>36 years of experience in GTM Engineering, Sales Engineering, Revenue Operations, Growth Engineering, or a similar role.</li>\n<li>Strong technical foundation with experience in APIs, system integrations, automation tools, and data workflows.</li>\n<li>Hands-on experience with CRM platforms (e.g., HubSpot, Salesforce) and sales/marketing automation tools.</li>\n<li>Ability to analyze data, build dashboards, and derive actionable insights to support commercial decisions.</li>\n<li>Strong problem-solving skills with a bias for ownership, experimentation, and execution.</li>\n<li>Excellent communication skills and ability to work cross-functionally with technical and non-technical stakeholders.</li>\n<li>Bachelors degree in Engineering, Computer Science, Information Systems, or a related field (or equivalent practical experience).</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>Preferred Qualifications</h2>\n<ul>\n<li>Experience working in a high-growth startup or scale-up environment, preferably in SaaS or fintech/insurtech.</li>\n<li>Familiarity with data tools such as SQL, Python, or modern BI platforms.</li>\n<li>Experience supporting enterprise or B2B sales cycles in emerging markets.</li>\n<li>Understanding of insurance, healthcare, or financial services ecosystems in Africa.</li>\n<li>Experience designing pricing experiments, revenue models, or growth experiments.</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>Benefits & Perks</h2>\n<ul>\n<li>Competitive salary and performance-based incentives.</li>\n<li>Opportunity to work on high-impact products transforming insurance across Africa.</li>\n<li>Fast-paced, ownership-driven culture aligned with Curacels PRESS values.</li>\n<li>Clear growth paths, learning opportunities, and exposure to leadership.</li>\n<li>Flexible work environment with a strong focus on outcomes over hours.</li>\n<li>Collaborative, innovative team that values initiative, urgency, and creativity.</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>About Curacel</h2>\n<p>Curacels mission is to make insurance workbetter, faster, and more transparentlyfor everyone. We leverage AI, automation, and data to combat fraud, streamline claims, and modernize insurance operations across Africa.\n\nOur culture is built around our PRESS values: Passionate Work, Relentless Growth, Empowered Action, Sense of Urgency, and Seeing Possibilities. We believe in giving our people ownership, trusting them to make decisions, and supporting them to grow.\n\nAt Curacel, your work has real impact. Every system you build, process you improve, and customer you enable helps strengthen insurance infrastructure and expand access to financial protection across the continent.</p>\n</div>	1	t	2026-01-03 19:28:21.825	2026-01-03 19:28:21.825
