n<h2>Required Qualifications</h2>\n<ul>\n<li>13 years of experience in HR, People Operations, or a similar administrative or operations role</li>\n<li>Bachelors degree in Human Resources, Business Administration, Psychology, or a related field</li>\n<li>Strong organizational skills with high attention to detail and ability to manage multiple priorities</li>\n<li>Working knowledge of core HR processes including onboarding, employee records, and basic labor compliance</li>\n<li>Proficiency with HR tools, Google Workspace, and basic data reporting or spreadsheets</li>\n<li>Excellent written and verbal communication skills with a peoplefirst mindset</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>Preferred Qualifications</h2>\n<ul>\n<li>Experience working in a tech startup, highgrowth company, or distributed team environment</li>\n<li>Familiarity with HRIS platforms, ATS tools, or payroll systems</li>\n<li>Basic understanding of African labor laws or multicountry HR operations</li>\n<li>Interest in people analytics, process improvement, or automation within HR</li>\n<li>Professional HR certification (e.g., CIPM, SHRM, HRCI) is a plus</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>Benefits & Perks</h2>\n<ul>\n<li>Competitive salary and benefits package</li>\n<li>Opportunity to grow within a fastscaling African technology company</li>\n<li>Exposure to strategic people operations and startup leadership</li>\n<li>Collaborative, inclusive, and highownership work culture</li>\n<li>Learning and development support aligned with Relentless Growth</li>\n<li>Flexible work environment built on trust and empowered action</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>About Curacel</h2>\n<p>Curacels mission is to make insurance work better for everyone by building the digital infrastructure that insurers need to operate efficiently and transparently. We envision a future where technology removes friction from insurance across Africa and beyond.\n\nOur culture is driven by our PRESS valuesPassionate Work, Relentless Growth, Empowered Action, Sense of Urgency, and Seeing Possibilities. We move fast, take ownership, and encourage bold thinking while supporting one another.\n\nAt Curacel, your work has real impact: enabling insurers to serve millions better, reducing fraud, and strengthening trust in financial systems. If youre excited about building peoplecentered systems in a highimpact environment, Curacel is the place for you.</p>\n</div>	1	t	2026-01-05 13:23:27.942	2026-01-05 13:23:27.942
8aeb17a5-5ca8-467d-b4b3-b7c3ad2c25a4	AI/ML Engineer	AI/ML	<div class="jd-section">\n<h2>Overview</h2>\n<p>Curacel is a leading African insurtech company building the digital infrastructure that powers insurance operations across the continent. Through cutting-edge AI, data, and automation, we help insurers reduce fraud, improve claims processing, and deliver better experiences to millions of customers. At Curacel, we move fast, take ownership, and build products that solve real, high-impact problems.\n\nAs an AI/ML Engineer, you will play a critical role in designing, building, and deploying machine learning models that sit at the core of our products. You will work on real-world challenges such as fraud detection, claims automation, risk scoring, and intelligent decision systems, transforming raw data into scalable, production-ready AI solutions.\n\nThis role matters because AI is central to Curacels mission. Your work will directly influence product performance, customer trust, and business outcomes across multiple insurance partners. You will help shape how AI is applied responsibly and effectively in one of Africas most impactful fintech sectors.</p>\n</div>\n<div class="jd-section">\n<h2>Key Responsibilities</h2>\n<ul>\n<li>Design, develop, train, and deploy machine learning models for production use cases such as fraud detection, claims automation, and predictive analytics</li>\n<li>Collaborate closely with product managers, backend engineers, and data analysts to translate business problems into scalable AI/ML solutions</li>\n<li>Build and maintain end-to-end ML pipelines, including data preprocessing, model training, evaluation, deployment, and monitoring</li>\n<li>Continuously improve model performance through experimentation, feature engineering, and model optimization</li>\n<li>Ensure models are reliable, explainable, and production-ready, with proper monitoring and retraining strategies</li>\n<li>Work with large, complex datasets and ensure data quality, integrity, and security</li>\n<li>Document models, processes, and experiments to support knowledge sharing and long-term maintainability</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>Required Qualifications</h2>\n<ul>\n<li>3+ years of hands-on experience building and deploying machine learning models in a production environment</li>\n<li>Strong proficiency in Python and common ML libraries such as TensorFlow, PyTorch, Scikit-learn, or similar</li>\n<li>Solid understanding of machine learning fundamentals, including supervised and unsupervised learning, model evaluation, and feature engineering</li>\n<li>Experience working with structured and unstructured data, including data cleaning and preprocessing</li>\n<li>Familiarity with APIs, microservices, and integrating ML models into backend systems</li>\n<li>Experience with cloud platforms (AWS, GCP, or Azure) and ML deployment workflows</li>\n<li>Bachelors degree in Computer Science, Engineering, Data Science, or a related field (or equivalent practical experience)</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>Preferred Qualifications</h2>\n<ul>\n<li>Experience with MLOps tools and practices such as model versioning, CI/CD for ML, and model monitoring</li>\n<li>Knowledge of fraud detection, risk modeling, or financial services use cases</li>\n<li>Experience working with big data tools or data warehouses</li>\n<li>Familiarity with NLP, computer vision, or deep learning applications</li>\n<li>Experience working in a fast-paced startup or scale-up environment</li>\n<li>Advanced degree (Masters or PhD) in a relevant field</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>Benefits & Perks</h2>\n<ul>\n<li>Opportunity to work on high-impact, real-world AI problems affecting millions of users across Africa</li>\n<li>A culture of ownership, innovation, and empowered decision-making aligned with Curacels PRESS values</li>\n<li>Competitive compensation and performance-based growth opportunities</li>\n<li>Collaborative, fast-paced work environment with talented engineers and product leaders</li>\n<li>Learning and development support, including exposure to modern AI tools and production systems</li>\n<li>Flexible work arrangements and a results-driven culture</li>\n</ul>\n</div>\n<div class="jd-section">\n<h2>About Curacel</h2>\n<p>Curacels mission is to make insurance work better for everyone by building the digital infrastructure that insurers need to operate efficiently and transparently. We envision an Africa where insurance is trusted, accessible, and powered by intelligent technology.\n\nOur culture is guided by our PRESS values: Passionate Work, Relentless Growth, Empowered Action, Sense of Urgency, and Seeing Possibilities. We believe in moving fast, taking ownership, and continuously learning.\n\nBy partnering with leading insurers and leveraging AI at scale, Curacel is transforming how claims are processed, how fraud is detected, and how trust is built in insurance systems across the continent. Joining Curacel means being part of a team creating meaningful impact at the intersection of technology and financial inclusion.</p>\n</div>	1	t	2026-01-08 16:54:32.694	2026-01-08 16:54:32.694
505578d6-6d58-4427-b073-91bd56c08d35	Account Executive (AE)	Sales	# **Account Executive** \n\nCuracel is building AI agents for financial services that automate work for insurers and are extending into other segments, such as banks and related financial services. \n\nYou will work alongside high-agency commercial executives, reporting to the Head of Sales and keeping close contact with the Founder/CEO. \n\nAs an AI-first company, we use AI to accelerate individual and team productivity; you will be highly proficient with AI tools and use them to maximise gains across the sales process. \n\n## **How you will help us win \\- day to day**\n\n* Build and execute a strategic territory plan using outbound, partners, events, and executive outreach to create and advance pipeline opportunities.  \n* Run full enterprise sales cycles from discovery to closecraft business cases, negotiate contracts, and deliver referenceable customers that drive future sales.  \n* Apply enterprise frameworks like MEDDIC to qualify deals, quantify success criteria, and define clear exit milestones at each stage.  \n* Coordinate cross-functional teams across product, solutions, legal, and delivery to ensure pilots and contracts move efficiently with seamless handovers.  \n* Maintain disciplined CRM hygieneaccurate forecasting, close plans, and next actions for consistent leadership reporting.  \n* Feed back market intelligence, customer proof points, and competitive signals to refine ICP, product direction, and GTM messaging \n\n## **What success looks like in 6 months**\n\n* New ARR closed: $250k+ with a mix of new logos and early expansions. Expect a 3-6 month ramp to full productivity; early months follow the company ramp plan and KPIs for demo and discovery activity.  \n* Pipeline health: consistent 34 qualified pipeline coverage against next two quarter targets, balanced between named accounts and sourced opportunities.  \n* Productivity: operating at expected ramp toward full quota, consistent forecasting and CRM hygiene. self-sourced demo and discovery meetings, discovery-to-proposal conversion, pipeline velocity, and average deal size.\n\n \n\n**You will be successful if you have**\n\n* 35 years of B2B enterprise sales experience with consistent quota attainment, preferably selling SaaS or enterprise technology into financial services or insurance across Sub-Saharan markets.  \n* Demonstrable experience running full enterprise cycles, closing 312 month deals and managing POCs to commercial outcomes.  \n* Strong consultative selling skills and practical use of MEDDIC or equivalent enterprise qualification.  \n* Proven CRM discipline and forecasting reliability.  \n* Self-motivation, high discipline and comfort coordinating distributed internal teams to close deals.\n\n## **Bonus points if you**\n\n* Have prior sales relationships in insurance and with large brokers.  \n* Speak Arabic, French or Swahili.  \n* Have hands-on SaaS experience and have used AI-enabled tools for research, outreach and meeting summaries.  \n* Have experience negotiating InfoSec, procurement and local contracting for FSI customers.\n\n**Comp**\n\n* Base \\+ Uncapped Commission; Accelerators\n\n**How we work**\n\nDo not apply if you are looking for work-life balance. We are looking for someone who is All In. These values are non-negotiable.\n\n* Passionate Work: Enjoy the work, set ambitious goals, and consistently exceed expectations  \n* Relentless Growth: Stay curious, set bold targets, and adapt quickly to learn  \n* Empowered Action: Own outcomes, take initiative, and communicate with clarity  \n* Sense of Urgency: Deliver fast with judgment, stay agile, and prioritise high-impact work  \n* Seeing Possibilities: Stay optimistic, focus on solutions, and persist through obstacles\n\n**About the interview \\- Our Process**\n\n* Chat with People Team  \n* Competency Assessment  \n* Interviews with Sales Team & Advisor  \n* Work Trial  \n* Chat with CEO\n\n**About Curacel**\n\nOur vision is prosperity for everyone. Our mission is to make financial services, starting with risk protection and healthcare, seamless, intelligent, and accessible.\n\nWe build AI that helps insurers, TPAs, banks, and providers automate work, reduce fraud, and deliver better experiences at scale.\n\nWe are building an AI agent platform that lets financial and health organisations deploy safe, useful agents for real operations. Brands plug in modern claims, compliance, and payment flows and go live quickly across markets.\n\nCuracel is trusted by leading insurers, including AXA, Liberty, Old Mutual, and Jubilee. Teams use Curacel to cut cycle times and process more claims with real-time decisioning. We serve 40 insurers across the Middle East & Africa.\n\nBy 2035, our infrastructure will serve hundreds of millions of people. As agentic AI matures, we will use our rails with insurers, banks, and providers to deliver next-generation financial protection and healthcare access at scale.\n\nWe have grown rapidly since launch, serving customers across multiple countries with strong retention and millions in annual revenue. We have raised millions of dollars from leading investors, including Y Combinator, Google, Tencent, etc.\n\n**Application Link** \\- [https://www.ycombinator.com/companies/curacel/jobs/DXnYT8L-enterprise-account-executive-updated](https://www.ycombinator.com/companies/curacel/jobs/DXnYT8L-enterprise-account-executive-updated) 	1	t	2026-01-14 19:30:53.213	2026-01-14 19:30:53.213
7b651d1e-053a-4ef1-b283-6d52294bc51c	Snr Product Manager	Product	# **The opportunity as Senior Product Manager**\n\nAs Senior PM at Curacel, you will shape the product vision for financial services and turn strategy into shipped, adopted, and monetized products. Your mandate is to define what and why, understand how at a technical depth, and accelerate how fast we grow. You will partner with Engineering, Design, GTM, and Leadership to build scalable systems, unlock growth, and deliver measurable outcomes across acquisition, activation, retention, and revenue.\n\nYou sit close to the CEO and Head of Product and act as a force multiplier for the product and platform. You will design and ship the systems that make teams radically more productive, from experiment cadence and roadmap hygiene to integrations that compound velocity. You will also use AI where it is practical, for example rapid prototyping, research acceleration, and GTM support.\n\nThis role blends product rigor with pragmatic use of AI. You will drive the company rhythm and outcomes while using AI selectively to speed product exploration and go to market. If you love turning ambiguous problems into simple products that scale, and you want your work to move the business every single week, this role is for you.\n\n## **What you will own**\n\n* **Own the growth engine end to end** across acquisition, activation, retention, monetization, and pricing. Define the growth model, set targets, and run a weekly experiment cadence that moves signup to qualified to paid, time to first value, expansion, and churn.  \n    \n* Product strategy and roadmap for a portfolio of core product and platform capabilities\n\n* Product specs, quality bars, and experiment backlogs with clear success criteria\n\n* Measurement systems for product health, experiment outcomes, and business impact\n\n  ## **What you will do**\n\n* **Tight GTM partnership with Sales and Marketing**. Align on ICP, positioning, and proof. Orchestrate launch plans, lifecycle messaging, and enablement that raise win rate, shorten cycles, and increase deal size. Share experiment readouts weekly and feed back insights to campaigns and outbound.\n\n* Run a high throughput experiment cadence with A/B tests, holdouts, and sequential testing for growth and features\n\n* Stand up product and exec dashboards that surface leading indicators and are always current\n\n* Ensure features are adopted, measured, and iterated. Close the loop with post mortems and learnings\n\n* Use AI tactically for speed where it helps, such as prototyping, research synthesis, and GTM content generation\n\n  ## **Technical depth and how you will use AI**\n\n* Strong platform literacy. APIs, webhooks, data pipelines, and vendor integrations\n\n* Rapid prototyping. Comfortable spinning up proof of concepts using tools like Replit or Lovable, and low code where it accelerates learning\n\n* Experimentation and data. Metric design, funnel analysis, A/B and quasi experiments, and power analysis\n\n* GTM enablement with AI. Use AI to draft messaging, sales collateral, and support content, with human edits and clear review gates\\\\  \n* Data and decisions. One source of truth for KPIs, KPI trees with weekly deltas, and BI plus SQL to monitor and adjust.\n\n  ## **What success looks like in 6 months**\n\n* Revenue growth driven by product. For example 10 to 20 percent lift in new ARR or expansion ARR from packaging, pricing, or feature adoption\n\n* Conversion and activation. Signup to qualified to paid rate up by 15 to 30 percent, time to first value down by 25 to 40 percent\n\n* Retention and expansion. Gross retention up 5 to 10 points or net revenue retention up 10 to 15 points through engagement and upsell paths\n\n* Experiment velocity. 3 to 5 meaningful experiments per week with decision quality documented and learnings reused\n\n* Delivery speed. 30 to 50 percent cycle time reduction from spec to shipped to adopted on 3 to 5 critical workflows\n\n* Operational visibility. One live product and growth dashboard used weekly by leadership with clear decision logs\n\n* Customer experience. Faster value delivery and fewer handoffs reflected in higher NPS or CSAT and reduced support burden\n\n  ## **You might be a fit if you have**\n\n* 6 plus years in product management with 2 to 3 years in growth or platform focused roles\n\n* Proven record shipping cross functional programs with measurable impact on adoption, engagement, revenue, and margins\n\n* Hands on prototyping and comfort partnering with engineers. You bias to working demos over long debates\n\n* Strong analytical chops. You define metrics, query data, and make decisions with evidence\n\n* Excellent communication and stakeholder management across internal and external audiences\n\n* Product management expertise with Agile or equivalent frameworks and a habit of writing\n\n  ## **Nice to have**\n\n* Experience in financial services, insurance, or other regulated industries\n\n* Light coding ability in Python or JavaScript to stitch systems and APIs\n\n* Familiarity with modern data stacks, event pipelines, and experimentation platforms\n\n  ## **How we work**\n\nDo not apply if you are looking for work life balance.\n\nThese are the values we hold dearly, they are non negotiable. We are looking for someone who is All In.\n\n* Passionate Work. Enjoy the work, set ambitious goals, and consistently exceed expectations\n\n* Relentless Growth. Stay curious, set bold targets, and adapt quickly to learn\n\n* Empowered Action. Own outcomes, take initiative, and communicate with clarity\n\n* Sense of Urgency. Deliver fast with judgment, stay agile, and prioritize high impact work\n\n* Seeing Possibilities. Stay optimistic, focus on solutions, and persist through obstacles\n\n\n	1	t	2026-01-14 21:41:16.18	2026-01-14 21:41:16.18
01e07a12-e9f1-4709-a977-ea469fed1b15	People Ops	People	## About the role\n\n### **The Opportunity**\n\nWe are building AI-powered insurance infrastructure across emerging markets. To keep pace with our growth, we need a high-output, systems-thinking People Operations leader who can design and run the people engine that powers the company.\n\nYou will architect and execute the core People Ops stack: performance frameworks, competency models, recruitment operations, onboarding, engagement, learning, compliance, and HR analytics, with AI embedded at every step. You will partner closely with leadership across functions to ensure we hire, onboard, grow, and retain high-performing teams across Africa and beyond.\n\nThis role blends operator rigor with AI craft: you will use automation, LLMs, and data to move 10x faster, reduce noise for Team Leads, and create a scalable, employee-centric People engine.\n\n### **What you will own and drive**\n\n* \\*\\*People operating system  \n  \\*\\*Design and execute the companys performance and competency architecture, which includes role scorecards, values and behaviors, AI proficiency levels, and quarterly review and OKR cycles. Leverage AI and analytics to consolidate feedback, surface performance signals, and facilitate transparent performance and calibration forums that drive clarity and accountability across the team.  \n* \\*\\*Talent engine  \n  \\*\\*Own and drive the talent lifecycle from role definition and interview rubrics to recruiting workflows and collaboration models with hiring managers and external recruiters. Leverage AI and funnel analytics to improve sourcing quality, reduce time-to-hire, and provide weekly hiring health updates to leadership, enabling faster and more informed decision-making.  \n* \\*\\*Onboarding and employee lifecycle  \n  \\*\\*Manage the entire onboarding process from pre-boarding to probation and internal mobility signals, ensuring new hires are productive quickly and supported throughout their lifecycle. Utilize the internal HR chatbot and automated workflows to address routine onboarding questions, task reminders, and documentation, while focusing on high-touch interventions for smoother transitions.  \n* \\*\\*Engagement and culture  \n  \\*\\*Run the engagement operating rhythm, including surveys, values "double-click" sessions, all-hands rituals, offsites/retreats, and recognition programs. Use AI to cluster feedback comments, identify key themes and risk areas, and translate engagement data into clear, actionable playbooks for leadership, enhancing employee satisfaction and retention.  \n* \\*\\*Learning & development stack  \n  \\*\\*Own the curricula (e.g., Talstack, CuraLearn), learning calendar, and capability playbooks for leaders, individual contributors, and emerging leaders. Implement AI and experimentation to refine learning formats such as formal training, peer learning, and AI literacy, measuring the impact of these programs on performance and role readiness for ongoing development.  \n* \\*\\*Policies and compliance  \n  \\*\\*Maintain a clean, accessible policy stack and employee handbook across all markets, ensuring strong documentation hygiene and process controls. Utilize AI to draft policies, communications, and automate approvals, acknowledgments, and version control, ensuring changes are well-governed while remaining simple and easily understood by employees.  \n* \\*\\*HR operations and payroll inputs  \n  \\*\\*Ensure data integrity across employee records, movements, and payroll change logs while coordinating payroll inputs and benefits administration with Finance and external providers. Automate recurring HR operations workflows such as reminders, approvals, and notifications to reduce errors, manual effort, and ensure compliance and auditability.  \n* \\*\\*People analytics and decision support  \n  \\*\\*Manage the core People analytics layer, including dashboards, KPI trees, and experiment logs that track headcount, hiring funnel, performance, engagement, and attrition insights. Use AI to accelerate analysis, segment data, and generate concise monthly People insight packs that provide actionable recommendations to leadership, driving key decisions.  \n* \\*\\*People tech stack  \n  \\*\\*Own and manage the HRIS/ATS, AI, and automation stack that supports People Operations. Continuously identify bottlenecks in workflows and design automation/AI experiments, documenting successful solutions into scalable playbooks.  \n* \\*\\*Office & asset support  \n  \\*\\*You will provide light-touch oversight of basic facilities and asset management, including hardware inventory, office readiness, and vendor coordination, ensuring employees have the resources they need to do their best work without unnecessary friction.\n\n### **What success looks like in 6 months**\n\n* Strong alignment with Curacels culture and mission, actively contributing to company-wide cultural initiatives and consistently reinforcing company values in People processes.  \n* Identified and addressed at least 1 process bottleneck or inefficiency across people processes, resulting in improved hiring, onboarding, or performance review cycles that save time and resources.  \n* Hiring operations: time-to-hire and process SLAs improved on priority roles; clean & reliable ATS and organizational satisfaction  8/10 on People support.  \n* Established strong relationships with leadership, contributing to strategy sessions with clear data-backed recommendations on people processes.  \n* Enhanced communication between teams on People Ops issues, ensuring smooth cross-functional coordination for recruitment, onboarding, performance evaluations, etc  \n* All new & updated policies and processes with matching documents & agreements in place.\n\n### **You might be a fit if you have**\n\n* 35 years in People Operations / HR generalist / HRBP roles in high-growth startups or tech environments  \n* Proven track record delivering core People Ops cycles: hiring operations, onboarding, performance management, engagement, and HR administration  \n* Experience implementing competency frameworks, role scorecards, and performance processes (not just participating in them)  \n* Strong funnel and people analytics skills: comfortable building and interpreting recruitment, performance, and engagement metrics  \n* Hands-on exposure to HRIS/ATS platforms, HR documentation, and payroll/benefits coordination  \n* Demonstrable comfort using AI tools (e.g. ChatGPT, Claude) and automation platforms (e.g. n8n, Zapier) in day-to-day work  \n* Good communication skills particularly with engaging in versatile team dynamics and stakeholder management skills across levels and geographies  \n* High ownership, attention to detail, and ability to operate in ambiguity without losing execution discipline\n\n### **Nice to have**\n\n* Experience supporting teams dispersed across multiple African and/or MENA markets  \n* Prior work building or running early-talent programs, internships, or graduate programs  \n* Light technical comfort: Boolean search, basic scripting, or API/automation wiring to stitch tools together  \n* Background in delivering targeted developmental programs either through design or facilitation.\n\n### **How we work**\n\nDo not apply if you are looking for a slow, low-maintenance HR job. We are looking for someone who is all in on building a high-performance, AI-enabled People engine for a company scaling across multiple markets. Our teams and leaders are passionate and driven, so we need someone ready to fit-in in terms of relatability, drive and capacity.\n\nOur non-negotiable values in this role:\n\n* Passionate Work: You enjoy the craft of People Operations, set ambitious goals, and consistently ship high-quality outcomes.  \n* Relentless Growth: You are a learning machineacross HR, AI, and businessand you turn feedback and data into upgraded systems.  \n* Empowered Action: You own outcomes, take initiative, and communicate with clarity; you dont wait for perfect instructions.  \n* Sense of Urgency: You move fast with judgment, focus on high-leverage work, and close loops quickly with stakeholders.  \n* Seeing Possibilities: You stay solution-oriented, optimistic, and persistent, even when solving messy people and systems problems.\n\nCompensation range in Naira per month (500,000 \\- 700,000)\n\n## About the interview\n\n### **Our process**\n\n* Chat with People Team  \n* Competency assessment (People Ops & AI usage)  \n* Chat with functional leaders  \n* Work trial / simulation  \n* Chat with CEO / Executive sponsor\n\n## About Curacel\n\nOur vision is prosperity for everyone. Our mission is to make financial services, starting with risk protection and healthcare, seamless, intelligent, and accessible.\n\nWe build AI that helps insurers, TPAs, banks, and providers automate work, reduce fraud, and deliver better experiences at scale.\n\nWe are building an AI agent platform that lets financial and health organizations deploy safe, useful agents for real operations. Brands plug in modern claims, compliance, and payment flows and go live quickly across markets.\n\nCuracel is trusted by leading insurers, including AXA, Liberty, Old Mutual, and Jubilee. Teams use Curacel to cut cycle times and process more claims with real time decisioning. We serve 40 insurers across the Middle East & Africa.\n\nBy 2035, our infrastructure will serve hundreds of millions of people. As agentic AI matures, we will use our rails with insurers, banks, and providers to deliver next generation financial protection and healthcare access at scale.\n\nWe have grown rapidly since launch, serving customers across multiple countries with strong retention and millions in annual revenue. We have raised million dollars from leading investors including Y Combinator, Google, Tencent, etc  \n	1	t	2026-01-14 21:51:42.372	2026-01-14 21:51:42.372
4c8a4ad8-5fea-425a-8ba8-06c8dd74a72a	Senior Fullstack Engineer	Engineering	# **Senior Full Stack Engineer**\n\n**Location:** Lagos or Remote  \n **Team:** Product & Engineering  \n **Reports to:** Engineering Lead\n\n## ** Your Objective**\n\nBe a foundational engineer who thrives in ambiguity and sets the technical bar. You are obsessive about solving problems with code and you live at the intersection of AI, engineering, and value creation. You are self aware enough to validate the problem behind what you build and you enjoy creating measurable customer value. You will design and ship end to end systems, partner tightly with Product, Design, Customer Success, and Sales on real customer workflows, and turn vague problems into shippable software with speed and quality.\n\n## **What you will do**\n\n* Design and build scalable, secure backend services and APIs from scratch; own infra, observability, and performance for what you ship.\n\n* Make pragmatic architectural decisions that balance speed, correctness, and long-term maintainability.\n\n* Partner with Product, Design, CS, and Sales to power high-value customer workflows and close the learnship loop.\n\n* Ship AI-assisted features and internal agents using prompt patterns, structured outputs, function calling, retrieval, and vector stores; measure quality with evaluation harnesses.\n\n* Build and maintain integrations between our Grow platform and third-party enterprise apps.\n\n* Lead technical design reviews; contribute to code and production-readiness reviews.\n\n* Mentor less-experienced engineers through pairing, clear examples, and actionable feedback.\n\n* Debug and resolve production issues across the stack with strong observability and crisp runbooks.\n\n* Build with security, privacy, and compliance in mind for regulated financial and insurance data.\n\n* Wear many hatsarchitect, builder, product partner, mentorand disagree-and-commit to keep the team moving.\n\n## **What you will own**\n\n* **Service quality:** performance, reliability, security, and cost awareness.\n\n* **Delivery cadence:** fast CI/CD, robust automated tests, incremental and reversible changes.\n\n* **Engineering standards:** DDD, clean OOP, code quality, and pragmatic documentation.\n\n* **Visibility:** self-serve dashboards for service health, latency, errors, and business KPIs.\n\n## **You might be a fit if you have**\n\n* 5+ years shipping production systems end-to-end, ideally with **Laravel** and **Vue**.\n\n* Strong system design for data-intensive, distributed, or event-driven systems.\n\n* Solid grasp of **CI/CD** and **TDD** with automated test suites and pipelines.\n\n* Working knowledge of **Domain-Driven Design** and clean OOP principles.\n\n* Hands-on mindset and high ownership; you learn what you need to get the job done and share that knowledge.\n\n* You tinker with AI weeklyLLMs, agents, evals, or automationand bring those wins into your workflow.\n\n* Clear communication, evidence-based decisions, and comfort operating in high-velocity environments.\n\n## **Our tech stack**\n\nFamiliarity is a plus, not a gate:\n\n* **Backend:** PHP, **Laravel**\n\n* **Frontend:** **Vue**, React Native, Electron\n\n* **Data/DB:** MySQL, MS SQL\n\n* **Cloud/Infra:** AWS and GCP (nice to have)\n\n* **Platform/Tooling:** Docker, Kubernetes (nice to have)\n\n* **Patterns:** APIs, webhooks, eventing, observability, DDD, clean architecture\n\n## **What success looks like in 6 months**\n\n* Ship customer features end to end. Take a problem from brief to production and adoption, partnering with Design and PM.  \n* Own a customer integration. Lead scoping, backend build, deployment, and QA for one real client integration.  \n* Improve reliability and quality. Reduce defects and tackle a couple of clear performance hotspots on a key service.  \n* Use AI to boost leverage. Put 2 to 3 lightweight agents or automations in place that save the team real hours.\n\n## **Why join us**\n\n* Be a core builder in an ambitious, AI-native InsurTech powering modern insurance infrastructure across Africa and the Middle East.\n\n* Work directly with leadership, ship weekly, and see your work move revenue, reliability, and customer outcomes.\n\n* High ownership, high learning rate, and a culture that values speed with judgment.\n\n## **How we work**\n\nDo not apply if you are looking for work life balance. We are looking for someone who is All In. These values are non negotiable.\n\n* Passionate Work: Enjoy the work, set ambitious goals, and consistently exceed expectations\n\n* Relentless Growth: Stay curious, set bold targets, and adapt quickly to learn\n\n* Empowered Action: Own outcomes, take initiative, and communicate with clarity\n\n* Sense of Urgency: Deliver fast with judgment, stay agile, and prioritize high impact work\n\n* Seeing Possibilities: Stay optimistic, focus on solutions, and persist through obstacles\n\n## **Our Process**\n\n* Technical Assessment 1 & 2\n\n* Chat with Engineering Lead \n\n* Work Trial\n\n* Chat with CEO\n\n	1	t	2026-01-14 22:02:09.865	2026-01-14 22:02:09.865
f1a4b89b-86b2-43d5-a66b-20c46fe45da3	AI/ML Engineer	Engineering	\n\n# **AI/ML Engineer (MidSenior Level, LLM Innovation & Deployment)**\n\n**Location:** Hybrid (Remote & On-site as needed)\n\n## **About Curacel**\n\nCuracel is building the future of insurance and healthcare infrastructure across emerging markets. From automating claims to preventing fraud and powering payments, we serve carriers, providers, and innovators across Africa, the Middle East, and beyond. We're now bringing that same ambition to a global scale, using AIparticularly LLMsto reimagine how insurance and healthcare work.\n\n## **The Role**\n\nWere looking for a **MidSenior AI/ML Engineer** to **go beyond product development** and own the entire lifecycle of our AI strategyfrom LLM experimentation to full-scale deployment across internal tools, operational systems, and external platforms.\n\nThis is not just a model-tuning role. You will have the mandate and freedom to **go to town** on every layer of our systems and workflows, finding opportunities to apply modern ML and LLMs (like GPT, Claude, Mistral) to unlock automation, intelligence, and efficiency at scale.\n\n## **What You'll Do**\n\n* **Lead LLM R\\&D:** Drive rapid experimentation with foundation models (e.g. GPT-4, Claude, open-source) to build intelligent workflows, agents, or copilots for internal and external use.\n\n* **Fine-Tune & Deploy Models:** Own the end-to-end process of fine-tuning LLMs and traditional ML models on domain-specific data, optimizing for performance, cost, and latency.\n\n* **Build Infra & Pipelines:** Architect and implement scalable ML infrastructure, training pipelines, evaluation frameworks, and deployment systems using Python and cloud-native tooling.\n\n* **Transform Internal Ops:** Use LLMs to supercharge internal workflows (e.g., customer support, claims triage, financial operations, reporting). Think of it like giving every team a custom AI assistant.\n\n* **Partner with Product & Engineering:** Work with cross-functional teams to bring AI experiments into production environments and ensure adoption by real users.\n\n* **Create a Culture of Applied AI:** Help us make AI a first-class citizen across the company, from early ideation to operational tooling.\n\n## **What We're Looking For**\n\n* **Hands-on Experience:** 37+ years building and deploying ML models, ideally with exposure to LLMs or NLP systems.\n\n* **Python Expert:** You write clean, efficient Python and know your way around ML libraries like PyTorch, TensorFlow, LangChain, Hugging Face Transformers, etc.\n\n* **Systems Thinker:** You understand software engineering and are comfortable working with backend services, APIs, vector DBs, Docker, cloud infra (AWS/GCP).\n\n* **Experiment-Driven:** Youre eager to try new tools and methods, set up baselines, test hypotheses quickly, and iterate based on resultsnot theory.\n\n* **Startup Energy:** Comfortable wearing many hats, solving ambiguous problems, and moving fast without rigid processes.\n\n* **Nice-to-Have:** Experience with retrieval-augmented generation (RAG), agent frameworks, or MLOps pipelines.\n\n## **Why Join Us**\n\n* **Massive Scope:** This is a blank canvas. Youll shape how AI is used across our company, from infrastructure to customer-facing experiences.\n\n* **Mission & Market:** Work on meaningful problems that improve access to healthcare and financial protection for millions globally.\n\n* **Momentum:** Backed by top-tier investors (Y Combinator, Tencent, Google), weve already processed hundreds of millions in claims and continue to grow.\n\n* **Team:** Youll collaborate with ambitious, curious, and kind teammates who value ownership, learning, and speed.\n\n---\n\n**Apply now** to build with purposeand to put LLMs to work in ways that actually matter.\n\n---\n\nWould you like this formatted for your careers page or as a Notion/Lever job post template as well?\n\n	1	t	2026-01-14 22:08:08.389	2026-01-14 22:08:08.389
