turn of Company Property: The Company shall not accept any responsibility for the loss or damage of your personal property, motor vehicle and/or any other personal belongings brought into the Company's premises in the course of your employment. Upon termination of employment with the Company for any reason or at any time prior at the Company's request, you shall return all property belonging to the Company or its affiliates including but not limited to, any Company-provided laptops, computers, cell phones, or other equipment, or documents, or property belonging to the Company.\n\nGoverning Law: The validity, interpretation, construction and performance of this Agreement, and all acts and transactions pursuant to this Agreement and the rights and obligations of the parties hereto shall be governed, construed and interpreted in accordance with the Laws of the Federal Republic of Nigeria.\n\nEntire Agreement: This Agreement contains the entire Agreement between the parties hereto with respect to the subject matter hereof, and supersedes all prior arrangements or understandings (whether written or oral) with respect thereto.\n\nSeverability: If any provision in this Agreement is held to be invalid or unenforceable in any jurisdiction, the validity and enforceability of all remaining provisions contained in this Agreement shall not in any way be affected or impaired.\n\nWe reserve the right to make reasonable changes to this Agreement and will notify you in writing of such changes. Such changes will be deemed to be accepted unless you notify us of any objections you may have before the commencement date. By signing this Agreement, you confirm with the Company that you are under no contractual or other legal obligations that would prohibit you from performing your duties with the Company.\n\nIf you wish to accept this offer, please sign and date both copies of this Agreement and both copies of the enclosed Confidential Information and Intellectual Property/Invention Assignment Agreement on or before %{offer_expiration_date} and return them to the undersigned representative of the Company.	t	t	{"bonus": {"type": "text", "label": "Bonus", "required": false}, "duties": {"type": "text", "label": "Primary Duties", "required": false}, "benefits": {"type": "text", "label": "Benefits", "required": false}, "job_title": {"type": "text", "label": "Job Title", "required": true}, "gross_salary": {"type": "text", "label": "Gross Salary", "required": true}, "employee_name": {"type": "text", "label": "Employee Name", "required": true}, "supervisor_title": {"type": "text", "label": "Supervisor Title", "required": true}, "employment_start_date": {"type": "date", "label": "Employment Start Date", "required": true}, "offer_expiration_date": {"type": "date", "label": "Offer Expiration Date", "required": true}}	t	2025-12-08 01:39:22.027	2025-12-29 02:23:41.797	FULL_TIME
